import React from "react";
import Benefits from "./Benefits";
import { Navbar, Nav, Container } from "react-bootstrap";

class Header extends React.Component {
  render() {
    return (
      <header>
        <input className="search" placeholder="search" />
        <a href={Benefits}></a>
      </header>
    );
  }
}

export default Header;
